import React from "react";
import { Card } from "antd";
import ageChecker from '../../Assets/Images/agechecker.jpg'


const Cards = () => {
  const cardData = [
    {
      title: "App Login Page",
      content: <a href=""img src = {ageChecker} />,
    },
    {
      title: "FakeStore Api Products Card",
      content: "",
    },
    {
      title: "Age Calculator",
      content: "",
    },
    {
      title: "",
      content: "",
    },
    {
      title: "",
      content: "",
    },
    {
      title: "",
      content: "",
    },
    {
      title: "",
      content: "",
    },
    {
      title: "",
      content: "",
    },
  ];

  return (
    <div className="flex items-center flex-wrap justify-around">
      {cardData.map((item, index) => (
        <Card
          key={index}      
          cover = {item.content}
          title = {item.title}
          className="w-[300px] h-[300px] mb-[50px] shadow-md "
        >
          
        </Card>
      ))}
    </div>
  );
};

export default Cards;
